import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../global.css';

const navLinks = [
  { label: 'Pricing', href: '/pricing' },
  { label: 'Services', href: '/services' },
  { label: 'Search', href: '/search' },
];

const Navbar = () => {
  const [isDropdownOpen, setDropdownOpen] = useState(false);

  return (
    <nav
      style={{
        width: '100%',
        backdropFilter: 'blur(16px)',
        background: 'rgba(15, 15, 15, 0.4)',
        color: '#fff',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        padding: '0 2.5rem',
        height: '72px',
        position: 'fixed',
        top: 0,
        left: 0,
        zIndex: 1000,
        borderRadius: '0 0 1rem 1rem',
        borderBottom: '1px solid rgba(255,255,255,0.05)',
      }}
      className="poppins"
    >
      {/* Logo */}
      <div style={{ display: 'flex', alignItems: 'center', flex: 1 }}>
        <img
          src={require('../assets/logo.png')}
          alt="Logo"
          className="logo"
          style={{ width: 160, height: 160, marginRight: '1.2rem', objectFit: 'contain' }}
        />
      </div>

      {/* Centered Nav Links */}
      <div
        style={{
          display: 'flex',
          flex: 2,
          justifyContent: 'center',
          alignItems: 'center',
          gap: '2.5rem',
          position: 'relative',
        }}
      >
        {navLinks.map((link) => (
          <Link
            key={link.label}
            to={link.href}
            className="poppins nav-underline"
            style={{
              color: '#fff',
              fontWeight: 600,
              fontSize: '1.1rem',
              textDecoration: 'none',
              position: 'relative',
              padding: '0.25rem 0.5rem',
              borderRadius: '0.3rem',
              transition: 'color 0.3s ease',
            }}
          >
            {link.label}
          </Link>
        ))}

        {/* DOWNLOAD dropdown */}
        <div
          className="poppins nav-underline"
          onMouseEnter={() => setDropdownOpen(true)}
          onMouseLeave={() => setDropdownOpen(false)}
          style={{
            color: '#fff',
            fontWeight: 600,
            fontSize: '1.1rem',
            cursor: 'pointer',
            padding: '0.25rem 0.5rem',
            borderRadius: '0.3rem',
            position: 'relative',
          }}
        >
          Download
          <div
            style={{
              position: 'absolute',
              top: '100%',
              left: 0,
              background: '#181818',
              boxShadow: '0 4px 20px rgba(0,0,0,0.3)',
              borderRadius: '8px',
              overflow: 'hidden',
              display: isDropdownOpen ? 'block' : 'none',
              zIndex: 1001,
              minWidth: '180px',
            }}
          >
            {[
  {
    name: 'Windows',
    icon: (
      <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="#4dff29">
        <path d="M3 4l8-1.3v9.3H3V4zm9 7.9V3l9-1.4v10.3h-9zm9 1.1v10.3l-9 1.4v-11.7h9zM11 20.3L3 19v-8.9h8v10.2z"/>
      </svg>
    ),
  },
  {
    name: 'macOS',
    icon: (
      <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="#4dff29">
        <path d="M16.365 1.43c0 1.14-.525 2.26-1.365 3.07-.72.7-1.875 1.24-3.035 1.12-.045-1.055.45-2.175 1.23-2.985.795-.825 2.07-1.44 3.165-1.205.015 0 .015 0 .015 0zm4.725 17.91c-.57 1.305-.84 1.875-1.575 3.015-1.02 1.56-2.43 3.5-4.185 3.51-1.59.015-2.01-1.02-4.17-1.005-2.175.015-2.61 1.035-4.2 1.02-1.755-.015-3.09-1.77-4.11-3.33-2.82-4.35-3.12-9.465-1.38-12.135 1.23-1.95 3.195-3.15 5.025-3.15 1.575 0 2.565.63 3.855.63 1.26 0 2.1-.63 3.855-.63 1.65 0 3.39.885 4.62 2.415-4.05 2.205-3.39 7.98.6 9.675z"/>
      </svg>
    ),
  },
  {
    name: 'Linux',
    icon: (
      <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="#4dff29">
        <path d="M12 0C8.688 0 6 2.688 6 6c0 3.156 2.906 6 6 6s6-2.844 6-6c0-3.312-2.688-6-6-6zm6.188 13.5c-.563 0-1.094.281-1.438.75-.563.844-1.625 1.406-2.75 1.406s-2.188-.563-2.75-1.406c-.344-.469-.875-.75-1.438-.75C8.25 13.5 6 15.75 6 18.563c0 1.219.469 2.344 1.25 3.219h9.5C17.531 20.906 18 19.781 18 18.563c0-2.813-2.25-5.063-5.813-5.063z"/>
      </svg>
    ),
  },
].map((os) => (
  <a
    key={os.name}
    href={`/${os.name.toLowerCase()}`}
    style={{
      display: 'flex',
      alignItems: 'center',
      gap: '10px',
      padding: '10px 16px',
      textDecoration: 'none',
      color: '#fff',
      fontWeight: 500,
      fontSize: '0.95rem',
      transition: 'background 0.2s',
    }}
    onClick={() => setDropdownOpen(false)}
    onMouseDown={(e) => e.preventDefault()}
    className="dropdown-item hover:bg-white/10 rounded"
  >
    {os.icon}
    {os.name}
  </a>
))}

          </div>
        </div>
      </div>

      {/* Login Button */}
      <div style={{ flex: 1, display: 'flex', justifyContent: 'center', paddingRight: '1rem' }}>
        <Link
          to="/login"
          className="poppins login-popout"
          style={{
            background: 'linear-gradient(135deg, #4DFF29, #9FFF62)',
            color: '#181818',
            fontWeight: 700,
            fontSize: '1.1rem',
            border: 'none',
            borderRadius: '0.5rem',
            padding: '0.75rem 2rem',
            cursor: 'pointer',
            textDecoration: 'none',
            transition: 'transform 0.2s ease, box-shadow 0.2s ease',
          }}
        >
          Login
        </Link>
      </div>

      {/* Styles */}
      <style>{`
        .nav-underline {
          display: inline-block;
          position: relative;
        }

        .nav-underline::after {
          content: '';
          position: absolute;
          width: 0%;
          height: 3px;
          bottom: -4px;
          left: 0;
          background-color: #4DFF29;
          transition: width 0.3s ease;
        }

        .nav-underline:hover::after {
          width: 100%;
        }

        .nav-underline:hover {
          color: #4DFF29;
        }

        .login-popout:hover {
          transform: translateY(-2px);
          box-shadow: 0 4px 20px rgba(77, 255, 41, 0.35);
        }

        .dropdown-item:hover {
          background-color: #222;
        }
          .os-select {
  width: fit-content;
  cursor: pointer;
  position: relative;
  transition: 300ms;
  color: white;
  overflow: hidden;
}

.os-selected {
  background-color: #2a2f3b;
  padding: 5px 10px;
  margin-bottom: 3px;
  border-radius: 5px;
  position: relative;
  z-index: 100000;
  font-size: 15px;
  display: flex;
  align-items: center;
  justify-content: space-between;
}

.os-arrow {
  height: 10px;
  transform: rotate(-90deg);
  width: 25px;
  fill: white;
  z-index: 100000;
  transition: 300ms;
}

.os-options {
  display: flex;
  flex-direction: column;
  border-radius: 5px;
  padding: 5px;
  background-color: #2a2f3b;
  position: relative;
  top: -100px;
  opacity: 0;
  transition: 300ms;
}

.os-select:hover > .os-options {
  opacity: 1;
  top: 0;
}

.os-select:hover > .os-selected .os-arrow {
  transform: rotate(0deg);
}

.os-option {
  border-radius: 5px;
  padding: 5px;
  transition: 300ms;
  background-color: #2a2f3b;
  width: 180px;
  font-size: 15px;
  display: flex;
  align-items: center;
  color: #4dff29;
}
.os-option:hover {
  background-color: #323741;
}

.os-options input[type="radio"] {
  display: none;
}

.os-options input[type="radio"]:checked + label {
  display: none;
}

.os-select:has(.os-options input[type="radio"]#all:checked) .os-selected::before {
  content: attr(data-default);
}
.os-select:has(.os-options input[type="radio"]#option-1:checked) .os-selected::before {
  content: attr(data-one);
}
.os-select:has(.os-options input[type="radio"]#option-2:checked) .os-selected::before {
  content: attr(data-two);
}
.os-select:has(.os-options input[type="radio"]#option-3:checked) .os-selected::before {
  content: attr(data-three);
}

      `}</style>
    </nav>
  );
};

export default Navbar;
